import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import Auth0ProviderWithHistory from './auth-config';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <React.StrictMode>
        <Auth0ProviderWithHistory>
            <App />
        </Auth0ProviderWithHistory>
    </React.StrictMode>
);
